import React, { Component } from 'react';

interface nft_list_props {
  storage: any;
}

class NFT_List extends Component<nft_list_props,nft_list_props>{

    constructor(props: nft_list_props) {
        super(props);
        this.state = {
          storage: props.storage
        };
    }

    render() {
      const Fragment = React.Fragment;

      if (this.props.storage){
        return (
        <div>
          current number of NFTs: {this.props.storage.length.toString()}
          <li>
           <span> 
              current stock: {this.props.storage.get("0")["current_stock"].toString()} 
           </span>
          </li>
          <li>
            <span>
              token price: {this.props.storage.get("0")["token_price"].toString()}
            </span>
          </li>
          <li>
            <span>
              token address: {this.props.storage.get("0")["token_address"].toString()}
            </span>
          </li>

        </div>
      );
      } else {
        return (
          <div>
            <span>
              None
            </span>
          </div>
          )

      }
    }
}

export default NFT_List;
